    <script>
    document.addEventListener('DOMContentLoaded', function() {
        setTimeout(function() {
            // Find the map and center on MetLife, then open popup
            var map = Object.values(window).find(v => v instanceof L.Map);
            if (map) {
                // Force center on MetLife Stadium
                map.setView([40.8135, -74.0745], 11);
                
                // Close all popups first
                map.closePopup();
                
                map.eachLayer(function(layer) {
                    if (layer instanceof L.Marker) {
                        var latlng = layer.getLatLng();
                        // MetLife is at approximately 40.8135, -74.07
                        if (Math.abs(latlng.lat - 40.8135) < 0.01 && Math.abs(latlng.lng - (-74.0745)) < 0.01) {
                            layer.openPopup();
                        }
                    }
                });
            }
        }, 100);
    });
    </script>
